"   <div class=\"block pha drugH1Div\" id=\"F158616\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Mechanism of Action",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Produces plasma volume expansion by virtue of its highly colloidal starch structure.",
"    </p>",
"   </div>",
"   <div class=\"block phk drugH1Div\" id=\"F158631\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pharmacodynamics/Kinetics",
"    </span>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Duration: Plasma expanding effect lasts 3-4 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Excretion: Urine (~75%) within 24 hours",
"    </p>",
"   </div>",
