" <div id=\"topicContent\">",
"  <div id=\"topicTitle\">",
"   Childhood lead poisoning: Management",
"  </div>",
"  <div id=\"topicContributors\">",
"   <div>",
"    <a id=\"authors\">",
"    </a>",
"    <a class=\"contributor contributor_credentials contributorType\" href=\"UTD.htm?21/5/21594/contributors\">",
