var title_f21_5_21596="Judging quality websites";
var content_f21_5_21596=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PC%2F77186&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=4\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PC%2F77186&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=4\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    How to judge the quality of a Web site",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Who produced the site?",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Is the site by a well-known and respected organization or recommended by someone you trust?",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Purpose of the site",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Who is the intended audience, and how was the site developed?",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Funding sources",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        All",
"sites are funded by someone. Do the producers of the site have a",
"financial conflict of interest that might bias the information?",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Date",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        The evidence base for health care is continually changing. The site should state when it was last updated.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        How the information is written",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Does the written presentation seem careful and balanced?",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Evidence",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Do",
"the authors base their recommendations on evidence, explicitly",
"identified (usually as a citation to a published research article)?",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Personal experiences",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Sharing",
"personal experiences can be useful to patients but should be clearly",
"marked as such and not be the only rationale for recommendations.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Communication",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        It should be possible to communicate with those responsible for the site.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Links",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        If the site is linked to other sites, it should explain how the others were chosen.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Disclaimers",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Sites",
"should state the limitations of what they have offered, such as",
"conflicts of interest and that the information they provide does not",
"replace contact with a physician.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Interactive facilities",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        If email lists, bulletin boards, or chat rooms are offered, users should be wary of who the participants are.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Adapted from www.judgehealth.org.uk",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
